import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import Login from './components/Auth/Login';
import GuestCitySelection from './pages/GuestCitySelection';
import GuestRoomBooking from './pages/GuestRoomBooking';
import GuestRestaurantOrders from './pages/GuestRestaurantOrders';
import GuestHotelFacilities from './pages/GuestHotelFacilities';
import GuestCheckout from './pages/GuestCheckout';
import BranchStaffDashboard from './pages/BranchStaffDashboard';
import AdminDashboard from './pages/AdminDashboard';
import CitySelectionPage from './pages/CitySelectionPage';
import RoomBookingPage from './pages/RoomBookingPage';
import RestaurantOrdersPage from './pages/RestaurantOrdersPage';
import HotelFacilitiesPage from './pages/HotelFacilitiesPage';
import CheckoutPage from './pages/CheckoutPage';
import FloorPlanPage from './pages/FloorPlanPage';
import BranchSelectionPage from './pages/BranchSelectionPage';
import StatisticsPage from './pages/StatisticsPage';
import GuestDashboard from './pages/GuestDashboard';

const App = () => {
    const role = localStorage.getItem('role');

    return (
        <Router>
            <Switch>
                <Route path="/admin-dashboard" component={AdminDashboard} />
                <Route path="/branch-staff-dashboard" component={BranchStaffDashboard} />
                <Route path="/guest/city-selection" component={GuestCitySelection} />
                <Route path="/guest/room-booking" component={GuestRoomBooking} />
                <Route path="/guest/restaurant-orders" component={GuestRestaurantOrders} />
                <Route path="/guest/hotel-facilities" component={GuestHotelFacilities} />
                <Route path="/guest/checkout" component={GuestCheckout} />
                <Route path="/city-selection" component={CitySelectionPage} />
                <Route path="/room-booking" component={RoomBookingPage} />
                <Route path="/restaurant-orders" component={RestaurantOrdersPage} />
                <Route path="/hotel-facilities" component={HotelFacilitiesPage} />
                <Route path="/checkout" component={CheckoutPage} />
                <Route path="/floor-plan" component={FloorPlanPage} />
                <Route path="/branch-selection" component={BranchSelectionPage} />
                <Route path="/statistics" component={StatisticsPage} />
                <Route path="/guest-dashboard" component={GuestDashboard} />
                <Route path="/login" component={Login} />
                <Route path="/">
                    {role === 'ADMIN' ? <Redirect to="/admin-dashboard" /> : role === 'STAFF' ? <Redirect to="/branch-staff-dashboard" /> : <Redirect to="/login" />}
                </Route>
            </Switch>
        </Router>
    );
};

export default App;
